  [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:48.472892\",\n\t\"name\": \"montana-2007-avian-influenza-surveillance-project-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this project were to
  employ multiple sampling strategies to maximize the change of detecting HP-H5N1,
  including sampling live and hunter-harvested waterfowl throughout fall migration,
  collecting environmental samples from areas of high waterfowl concentration, and
  collecting samples from wild bird mortality/morbidity events. To achieve the 2007
  objectives, personnel from Montana Fish, Wildlife and Parks and USDA-APHIS Wildlife
  Services collecte1502 swab samples from live and hunter-harvested birds, 649 environmental
  samples, and 59 mortality/morbidity samples. Six weekly prospective mortality transects
  (n=103) were also conducted on lakes and wetlands throughout the state to systematically
  record the presence of target bird populations and mortality events.\",\n\t\"license_title\":
